import React from "react";

interface PlayProps {
  changeGamemode: (selectedGamemode: string) => void;
}

export default function Play(props: PlayProps) {
  return (
    <div>
      <button
        onClick={() => {
          props.changeGamemode("classicSnake");
        }}
      >
        Classic Snake
      </button>
      <button
        onClick={() => {
          props.changeGamemode("bricksSnake");
        }}
      >
        Bricks Snake
      </button>
    </div>
  );
}
